function InputTask({ onAdd }) {

    function submitTask(event) {
        if (event) {
            onAdd(event);
            console.log("WTF")
        }   
        event = ""
    }

    return (
        <Input.Search
            placeholder="Your task..."
            allowClear
            enterButton="Add"
            onSearch={submitTask}
        />
    );
}

export default InputTask;
